-- Datamart 1: City Revenue Summary
-- Explanation: This view provides a summary of city-wise revenue, including the top 10 cities with the highest revenue.
DROP VIEW IF EXISTS CityRevenue;
-- Create the view
-- Drop the view if it exists
DROP VIEW IF EXISTS CityRevenue;
-- Create the view
DROP VIEW IF EXISTS CityRevenue;
CREATE VIEW CityRevenue AS
SELECT
    City,
    State,
    TotalRevenue
FROM Supermarket_info
GROUP BY
    City,
    State,
    TotalRevenue
ORDER BY TotalRevenue DESC
LIMIT 10;
SELECT * FROM CityRevenue;

